


function print() {


	// var canvas = document.getElementById("canvas");
	// var imgData = canvas.toDataURL("image/jpeg", 1.0);
	var imgData ="data:image/png;base64,";
	var doc = new jsPDF({
	format : 'letter',
	unit : 'in'
	})

	doc.addFont('Latin Modern Roman 10 Regular', 'lmroman', 'normal');
	// doc.addFont('LMRoman10-Italic', 'lmroman', 'italic');
	// doc.addFont('LMRoman10-Bold', 'lmroman', 'bold');
	// var a = doc.addFont('LMRomanCaps10', 'lmroman-caps', 'normal');
	// console.log(a);
	console.log(doc.getFontList());

	var marginleft = 0.75;
	var margintop = 0.5;
	var marginbetween = 0.0;
	var fraction = 1.0;


	var title = document.getElementById('title').value;
	var subtitle = document.getElementById('subtitle').value;
	var lot = document.getElementById('lot').value;
	var price = document.getElementById('price').value;

	for (var i = 0; i < 5; i++) {
		for (var j = 0; j < 2; j++) {
			var leftspace = marginleft + j*(3.5*fraction)
			var topspace = margintop+i*2.0*fraction+i*marginbetween
			doc.addImage(imgData, 'PNG', leftspace, topspace, 3.5*fraction,2.0*fraction);


			//Add title
			doc.setFont('times');
			doc.setFontType("normal");
			doc.setFontSize(10);
			doc.text(leftspace+0.72, topspace+0.575, "Un grand vin du Languedoc")

			//Add title
			doc.setFont("times");
			doc.setFontType("normal");
			doc.setFontSize(18);
			doc.text(leftspace+0.72, topspace+0.8, title)

			//Add subtitle
			doc.setFont("times");
			doc.setFontType("italic");
			doc.setFontSize(10);
			doc.text(leftspace+0.72, topspace+0.96, subtitle)

			//Add subtitle
			doc.setFont("times");
			doc.setFontType("normal");
			doc.setFontSize(10);
			doc.text(leftspace+0.72, topspace+1.48, lot)

			//Add subtitle
			doc.setFont("times");
			doc.setFontType("normal");
			doc.setFontSize(10);
			doc.text(leftspace+2.97, topspace+1.48, price);

			//Add domain
			doc.setFont("times");
			doc.setFontType("normal");
			doc.setFontSize(8.5);
			doc.text(leftspace+0.72, topspace+1.68, "Domaine Jean-Richard Laurence & Marie-Soleil Paquet");

			//Add adress
			doc.setFont("times");
			doc.setFontType("italic");
			doc.setFontSize(8.5);
			doc.text(leftspace+0.72, topspace+1.82, "11590 Cuxac d'Aude, France");
		}
	}
	
	doc.save('a4.pdf')

	
}

